import '../../css/additional.css'

const InteriorItem = ({ interior, setInterior, selected }) => {

    const imgUrl = "http://localhost:3000/" + interior.thumbnailUrl + ".webp";

    return (
        <div className="mb-3 mx-3 d-inline-block">
            <div className>
                <div><button className="color-button" onClick={() => setInterior(interior)} style={{ "background": `url(${imgUrl})`, "background-size": "60px 60px", "backgroundRepeat": "no-repeat" }} ></button></div>
                <input className="form-check-input" type="radio" checked={selected} onClick={() => setInterior(interior)} onChange={() => ""} />
            </div>
        </div>

    )

}

export default InteriorItem;
